import React from "react"
import logo from './logo.svg';
import "./App.css"
import {
  ChatkitProvider,
  TokenProvider,
  withChatkit,
} from "@pusher/chatkit-client-react"

const instanceLocator = "v1:us1:09f679ce-bb4d-4a68-a035-3cd337905ada"
const userId = "bob"

const tokenProvider = new TokenProvider({
  url: "https://us1.pusherplatform.io/services/chatkit_token_provider/v1/09f679ce-bb4d-4a68-a035-3cd337905ada/token",
});

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <WelcomeMessage />
        <ChatkitProvider
          instanceLocator={instanceLocator}
          tokenProvider={tokenProvider}
          userId={userId}>
          <WelcomeMessage />
        </ChatkitProvider>


        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  )
}

// const WelcomeMessage = props => {
//   return <div>Hello Chatkit!</div>
// }
const WelcomeMessage = withChatkit(props => {
  return (
    <div>
      {props.chatkit.isLoading
        ? 'Connecting to Chatkit...'
        : `Hello ${props.chatkit.currentUser.name}!`}
    </div>
  );
});

export default App
